import React , {useState} from 'react';
import './App.css';
import Nav from './Components/Nav/Nav';
import Body from './Components/Body/Body';
import Footer from './Components/Footer/Footer';

function App() {
  const [data , setData] = useState([
    {
      name: '',
      phone: '',
      email: ''
    }
  ]);
  return (
    <div className="App">
      <Nav></Nav>
      <Body data={ data }></Body>
      <Footer></Footer>
    </div>
  );

}

export default App;
